-- ----------------------------
-- Table structure for ieps_file_hub
-- ----------------------------
DROP TABLE IF EXISTS `ieps_file_hub`;
CREATE TABLE `ieps_file_hub`  (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `type_num` varchar(30) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '-1',
  `user_num` varchar(20) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL,
  `academy` varchar(100) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '上传人的所在学院',
  `file_name` varchar(100) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL,
  `file_size` int(11) NULL DEFAULT NULL,
  `file_kind` int(10) NULL DEFAULT 0 COMMENT '-1：普通文件；0：重要通知文件；1：常用下载文件；2：申请项目文件；3：立项评审结果附件；4：中期检查评审结果附件；5：结题评审结果附件。',
  `create_time` datetime(0) NULL DEFAULT CURRENT_TIMESTAMP(0),
  `update_time` datetime(0) NULL DEFAULT CURRENT_TIMESTAMP(0),
  PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 20 CHARACTER SET = utf8 COLLATE = utf8_general_ci ROW_FORMAT = Dynamic;

