DROP TABLE IF EXISTS `ieps_inform`;
CREATE TABLE `ieps_inform`  (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '系统通知id',
  `head` varchar(100) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '通知标题',
