-- ----------------------------
-- Table structure for ieps_item
-- ----------------------------
DROP TABLE IF EXISTS `ieps_item`;
CREATE TABLE `ieps_item`  (
  `item_id` int(11) NOT NULL AUTO_INCREMENT COMMENT '项目id',
  `item_num` varchar(20) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '项目编号',
  `item_name` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '项目名称',
  `leader_num` varchar(20) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '项目负责人学号',
  `leader_name` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '项目负责人',
  `tutor_num` varchar(20) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '职工号',
  `tutor_name` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '指导老师姓名',
  `item_status` int(11) NULL DEFAULT NULL COMMENT '<!-- 项目状态：1：申请中；2：立项评审；3：已立项；4：立项失败；5：中期检查; 6: 待结题；7：结题评审；8：结题成功；9：结题失败-->',
  `item_date` datetime(0) NULL DEFAULT CURRENT_TIMESTAMP(0) COMMENT '申报时间',
  `create_time` datetime(0) NULL DEFAULT CURRENT_TIMESTAMP(0) COMMENT '创建时间',
  `update_time` datetime(0) NULL DEFAULT CURRENT_TIMESTAMP(0) COMMENT '更新时间',
  `item_contract` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '项目合同书地址',
  `item_concluding_report` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '项目结题报告地址',
  PRIMARY KEY (`item_id`) USING BTREE,
  INDEX `item_num`(`item_num`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 500131 CHARACTER SET = utf8 COLLATE = utf8_general_ci ROW_FORMAT = Dynamic;

