-- Table structure for ieps_item_info
-- ----------------------------
DROP TABLE IF EXISTS `ieps_item_info`;
CREATE TABLE `ieps_item_info`  (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '项目详细id',
  `item_num` varchar(30) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '项目id',
  `item_level` int(11) NULL DEFAULT 1 COMMENT '项目级别：1: 无；2：校级；3：省区级；4：国家级',
  `item_type` int(11) NULL DEFAULT 1 COMMENT '项目类型：1：创新训练；2：创业训练；3：创业实践',
  `summary` varchar(500) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '项目简介',
  `college_funds` decimal(10, 2) NULL DEFAULT 0.00 COMMENT '校拨经费',
  `govern_funds` decimal(10, 2) NULL DEFAULT 0.00 COMMENT '财政经费',
  `create_time` datetime(0) NULL DEFAULT CURRENT_TIMESTAMP(0) COMMENT '创建时间',
  `update_time` datetime(0) NULL DEFAULT CURRENT_TIMESTAMP(0) COMMENT '更新时间',
  PRIMARY KEY (`id`) USING BTREE,
  INDEX `item_num`(`item_num`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 510173 CHARACTER SET = utf8 COLLATE = utf8_general_ci ROW_FORMAT = Dynamic;

